import CostItem from "./components/CostItem";

function App() {
  const cost = [
    {
      date: "55",
      description: "Холодильник",
      amount: 999.99,
    },

    {
      date: "44",
      description: "Ноутбук",
      amount: 1275.78,
    },

    {
      date: "99",
      description: "Одежда",
      amount: 500.66,
    },
  ];

  return (
    <div>
      <h1>Начинаем изучение React</h1>
      <CostItem
        date={cost[0].date}
        description={cost[0].description}
        amount={cost[0].amount}
      />
      <CostItem
        date={cost[1].date}
        description={cost[1].description}
        amount={cost[1].amount}
      />
      <CostItem
        date={cost[2].date}
        description={cost[2].description}
        amount={cost[2].amount}
      />
    </div>
  );
}

export default App;
